import React, {Component} from 'react';
import '../style/bootstrap-4.1.3-dist/css/bootstrap.css';
import '../style/app.css';

class App extends Component{
    constructor(props){
        super(props);
        this.state = {};
    }

    render(){
        return(
            <div className="container">
            <div className="row">
                <h1 className="title">Matcha</h1>
            </div>
            </div>
        );
    }
}

export default App;
